import React, { useState } from "react";
import movies from "../movies";
import Movie from "./Movie";
import { useLocation } from "react-router-dom";
import Nav from "./Nav";
function Home() {
  const location = useLocation();
  return (
    <>
      alert
      <Nav />
      <div className="moviesss-container">
        {movies.map((data) => (
          <Movie
            id={data.id}
            year={data.year}
            title={data.title}
            poster={data.poster}
            genre={data.genre}
          />
        ))}
      </div>
    </>
  );
}

export default Home;
